import React from "react";
import "../Components/RegisterForm.css";
// import "../Components/test2.css";
import NavBar from "./Navbar";
import logo from "../Images/penguin-logo.png";
// import { Button, FormControl, Form, Col } from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faEye,
  faEyeSlash,
  faUserAlt,
} from "@fortawesome/free-solid-svg-icons";
import userIcon from "../Images/userIcon.png";
import pwdIcon from "../Images/passwordIcon.png";
import Fade from 'react-reveal/Fade';

const RegisterForm = () => {
  const handleClick = () => {
    console.log("Clicked");
  };

  const wrongDetails = false;

  return (
    <div className="maincontainer bg-image-register">
      <div className="container-fluid">
        <div className="row no-gutter">

          <NavBar />
          <Fade bottom duration={1000} delay={100} distance="30px">
          <div class="container">
            <div class="d-flex justify-content-center h-100">
              <div class="card">
                <div className="text-center pt-3">
                  <img
                    src={logo}
                    className="penguin-logo-register"
                    alt="penguin-logo"
                  ></img>
                </div>
                <div className="title-spacing">
                  <h3>Register</h3>
                </div>
                <div class="card-body">
                  <form>
                    <div class="input-group form-group">
                      <div class="input-group-prepend">
                        <span class="input-group-text">
                          {" "}
                          <img
                            className="userIcon"
                            alt="userIcon"
                            src={userIcon}
                          />
                        </span>
                      </div>
                      <input
                        type="text"
                        class="form-control"
                        placeholder="username"
                      ></input>
                    </div>
                    <div class="input-group form-group">
                      <div class="input-group-prepend">
                        <span class="input-group-text">
                          <img
                            className="userIcon"
                            alt="userIcon"
                            src={pwdIcon}
                          />
                        </span>
                      </div>
                      <input
                        type="password"
                        class="form-control"
                        placeholder="password"
                      ></input>
                    </div>

                    <div class="form-group">
                      <input
                        type="submit"
                        value="Register"
                        class="btn float-right login_btn"
                      ></input>
                      {/* <Button className='login_btn'>Register</Button> */}
                    </div>
                  </form>
                </div>
                <div class="card-footer">
                  <div class="d-flex justify-content-center links">
                    Already have an account?<a href="/signin">Sign In</a>
                  </div>
                </div>
              </div>
            </div>
          </div>
          </Fade>
        </div>
      </div>
    </div>

  );
};

export default RegisterForm;
